import './App.css';
import { Routes, Route } from 'react-router-dom';
import AuthPage from './components/AuthPage';

function App() {
  return (
    <div className="App">
      <Routes>
        <Route element={<AuthPage />} />
      </Routes>
    </div>
  );
}

export default App;
